import React from 'react';
import { connect, ConnectedProps } from 'react-redux';
import {Posts, Post} from './store/Types/States'
import * as actionCreators from './store/actions/postactions'


const mapStateToProps = (state:Posts) => {
  return([...state.posts])
};

const mapDispatchToProps = () => {
  return {
    getAllPosts: () => (actionCreators.getALlPosts()),
    getOnePost: (id:number) => (actionCreators.getOnePosts(id)),
    getComment: (postId:number) => (actionCreators.getComments(postId)),
    postData: (data:Post) => (actionCreators.PostData(data)),
    deletePost: (id:number) => (actionCreators.DeletPost(id))
  }
};

const connector = connect(mapStateToProps, mapDispatchToProps)

// The inferred type will look like:
// {isOn: boolean, toggleOn: () => void}
type PropsFromRedux = ConnectedProps<typeof connector>

type Props = PropsFromRedux 
function App(props:PropsFromRedux) {

  return (
    <div className="App">
      <button onClick={props.getAllPosts()}>Get All Posts</button>
      <button onClick={props.getOnePost(1)}>Get Post (1)</button>
      {/* <button onClick={props.getComments(1)}>Get Commnet Of Post (1)</button>
      <button onClick={props.deletePost(1)}>Get Delete Post (1)</button>
      <button onClick={props.deletePost(1)}>Get Delete Post (1)</button> */}

    </div>
  );
}



export default  connector(App);
